VALUES ('20507664', 'Huile d\'olive', 'bij de eerste persing veikregen uitsluitend bestaat uit geraffineerde olijfolie-n \'freeks uit olijven verkregen olie. Tegen warmte en zon ioschermen. Bij een bewaring onder de +7 oc kan troeV Ad of vlokvorming ontstaan. Dit verschijnsel is normaal$Ë fiiÌloedt de kwaliteit niet. Bij kamertemperatuur wordt de Deze Olie is geschikt voor de bereiding van warme ei koude gerechten. Ongeopend, ten minste houdbaar tot: zie flessenhals. Huile dlolive - composée dlhuiies d\'olive raffinées et d\'huiles d\'olive vierges. Huile contenant exclusivement des huiles d\'olive ayant subi un traitement de raffinage et des huiles obtenues directement des olives. À conserver à l\'abri de la chaleur et de la lumière. En cas de conservation en dessous de +70C, l\'huile peut se troubler ou former des flocons. Ce phénomène est normal et n\'altère pas la qualité du produit. À température ambiante, l\'huile redevient claire. Cette huile d\'olive convient pour les préparations froides ou chaudes. Non ouvert, à consommer de préférence avant le: voir goulot.', 'https://static.openfoodfacts.org/images/products/20507664/front_en.5.400.jpg', '92', '14', '0', '0', '0', '0', '0', '0', '', '0');

