VALUES ('20530730', 'Pizza Diavola', '50% pâte : farine de _blé_ tendre, eau, huile de tournesol, sel de cuisine, levure, gluten de blé, farine de malt de blé tendre, antiagglomérant : carbonate de calcium; agent de traitement de la farine : acide ascorbique, enzymes (contiennent _blé_). 50% garniture : purée de tomate, purée de tomates mi-réduite, 16,6% Mozzarella (_lait_, sel de cuisine, ferments lactiques, présure), 14,7% oignon rouge, 13,8% saucisse épicée (95,6% viande de porc, sel de cuisine, arômes naturels, épices, arômes de fumée, dextrose, saccharose, antioxydant : acide ascorbique; conservateurs: nitrite de sodium, nitrate de potassium), eau, 5,2% Nduja (46% viande de porc, gras de porc, piment, huile d‘o|ive, sel de cuisine, dextrose, saccharose, arôme de fumée, antioxydant : acide ascorbique; conservateur : nitrite de sodium), poivron rouge mariné (poivron, eau, vinaigre, sucre, sel de cuisine, séquestrant : chlorure de calcium), amidon modifié de maïs, huile d\'olive vierge extra, sucre, Pecorino (_lait_), huile de tournesol, sauce au piment (piment rouge, huile d\'olive, sel de cuisine, ail), piment, sel de cuisine, basilic, ail.', 'https://static.openfoodfacts.org/images/products/20530730/front_fr.7.400.jpg', '7', '2.7', '27.1', '3', '', '9.4', '1.29', '0.507874015748031', '', '0');

