VALUES ('20533267', 'Sushi Box Naniwa', 'Sushis : 78,2 % préparation de riz [riz cuit (eau, riz, huile de tournesol), sirop de glucose-fructose, vinaigre de riz, sel, correcteur d\'acidité : acétates de sodium], 8,1 % saumon cru (_poissons_), 3,8 % poivron vert, 2,6 % crevette cuit (crevette (_crustacés_), sel), 2,3 % surimi à base de protéines de muscles de poisson [56 % surimi (protéines de muscles de _poisson_, sucre, eau, amidon de _blé_, amidon modifié de pomme de terre, blanc d\'_œuf_ en poudre réhydraté, sucre, sel, arôme naturel (contient des _crustacés_), colorant : extrait de paprika], mayonnaise (huile de colza, jaune d\'_œuf_, eau, vinaigre d\'alcool, graines de _moutarde_, sucre, sel, épices), varech séché, concombre, 0,3 % préparation d’œufs de poisson (95 % œufs de capelan (_poissons_), sucre, sel, fructose, colorants : carmins, curcumine). Sauce soja : eau, fèves de _soja_, _blé_, sel. Préparation au gingembre : gingembre, sirop de glucose-fructose, sel, acidifiants : acide acétique, acide citrique. Préparation au raifort : eau, 17 % raifort en poudre, farine de _moutarde_, wasabi en poudre, colorants : complexes cuivre-chlorophylles et cuivre-chlorophyllines, curcumine.', 'https://static.openfoodfacts.org/images/products/20533267/front_fr.5.400.jpg', '2', '0.3', '25', '9.2', '', '4.6', '2.15', '0.846456692913386', '', '0');

