VALUES ('20534004', 'Wrap poulet rôti sauce Caesar', 'Galette de _blé_ aux graines de lin (47%) : farine de _blé_, eau, huile de colza, graines de lin (1,1%*), poudres à lever : carbonates de sodium, diphosphates ; dextrose, acidifiant : acide malique ; sel. * Pourcentage exprimé sur la galette. Garniture (53%) : filet de poulet rôti traité en salaison (32%**) (filet de poulet, eau, acidifiants : lactate de potassium, acétates de potassium ; amidon modifié de pomme de terre, dextrose, sel, stabilisant : triphosphate ; sucre brun, antioxydant : érythorbate de sodium), sauce au fromage blanc (_lait_) (31%**) (fromage blanc (_lait_), huile de colza, eau, vinaigre, amidon modifié de pomme de terre, jaunes d’_œufs_, sucre, _moutarde_ de Dijon (eau, graines de _moutarde_, vinaigre, sel, acidifiant : acide citrique ; antioxydant ; disulfite de sodium), arôme (_poissons_), sel, épaississants : gomme guar, gomme xanthane ; conservateur : sorbate de potassium), salade (15%**), tomates (10%**), fromage au _lait_ de vache pasteurisé (7%**) (_lait_ de vache, ferments lactiques (_lait_), sel, présure animale, chlorure de calcium, anti-mottant : fécule de pomme de terre), tomates marinées (5%**) (tomates semi-déshydratées, huile de colza, sel, origan, ail), amidon modifié de pomme de terre. ** Pourcentages exprimés sur la garniture.', 'https://static.openfoodfacts.org/images/products/20534004/front_fr.27.400.jpg', '7.4', '1.6', '24.7', '2.3', '', '10', '1.2', '0.47244094488189', '', '0');

