VALUES ('20543068', 'American Style Pizza Peperoni-salami', 'farine de blé, 20,9% tomates concassées Â14 fromage (11,4% mozzarella (lait), 3,4% fromage cheddar [lait de vache pasteurisévsel de cuisifie, fermente \' lactiques, présure microbienne]), eau, 7 % poivrons, 6,8% salami* piquante fumé (viande de porc, lard, sel de cuisine Conservateur: nitrite de sodium; épices, dextrose, extraits d\'épices [poivre noir, poivre blanc], antioxydant: érythorbate sodium, extraits de romarin; BE: fumée), huile de colza, levure, sel de cuisine, sucre, farine de malt de blé, fenouil, poivr( de Cayenne. *100g salami piquante sont elaborés à partir de 137g de viande de porc. Peut contenir des traces de soïa d\'œuf, de céleri, de moutarde et de sésame. Préparation: préchauffer le four. Sortir la pizza surgelée du congélateur e retirer le film plastique. Placer la pizza sur la grille en bas du four. Four électrique 220 C, fourà chaleur tournante 20070 four à gaz: niveau 3-4. Temps de cuisson: 16-20 minutes. La pizza est prête à servir lorsque le fromage est fondu doré e que le fond est cuit comme vous le désirez, brun clair à brun foncé. Suivre les instructions de votre four! Le temps cuisson peut varier en fonction de l\'appareil. Le meilleur résultat de cuisson est obtenu avec un four électrique. Elabor( en Allemagne. Conservation: réfrigérateur (max. +70C): 1 jour, *compartiment à glaçons (-60C): 4 jours *congélateur (-12 oc): 2 semains; *** congélateur: non ouvert,', 'https://static.openfoodfacts.org/images/products/20543068/front_fr.4.400.jpg', '8', '3.5', '27', '2.6', '', '9.5', '1.16', '0.456692913385827', '', '0');

