olati au lait (sucre, beurre de cacaol, poudre de lait entier, pâte de cacaol, émulsifiant : lécithines (soja), arôme naturel de vanille), éclats de crêpe dentelle (farine de blé, sucre, beurre concentré, lait en poudre écrémé, malt d orge, sel). Décors (1,0%) : plaquette décor au chocolati (pâte de cacaol, sucre, beurre de cacaol, arôme naturel de vanille, émusifiants : lécithines (soja), polyricinoléate de polyglycérol ; colorant : dioxyde de titane), décor étoile (sucre, farine de riz, huile de palme, colorants : caroténoïdes, dioxyde de titane, oxyde et hydroxyde de fer ; agent d \'enrobage : shellac ; épaississant : gomme adragante ; arôme). *issu de poules élevées en plein air. 1 Cacao certifié UTZ 100% Mass Balance. Traces éventuelles d\'autres fruits à coque.', 'https://static.openfoodfacts.org/images/products/20593674/front_fr.8.400.jpg', '18', '10', '33', '27', '', '4.9', '0.16', '0.062992125984252', '', '0');

