VALUES ('20612290', 'Civet de Marcassin à la sauce chasseur', '65% sauce chasseur (39% vin rouge (sulfite), 11 % champignon, eau, 8,8% gelée de groseille (sirop de glucose-fructose, 45% jus de groseille, sucre, gélifiant: pectines; acidifiant: acide citrique), 7,6% carotte, 6,9% oignon grelot, fond de veau (amidon de pomme de terre, viande de veau concentrée, arôme (blé), sel, extrait de levure, tomate, graisse de poulet, oignon, vinaigre, sirop de glucose, sucre, épices, plantes aromatiques, antioxydant: extraits de romarin), 3,4 % lardons (96% viande de porc, sel, sirop de glucose, antioxydant: érythorbate de sodium; conservateurs: nitrite de sodium, nitrate de potassium; fumée), huile d\'olive vierge extra, fond de gibier (arôme (blé), amidon de pomme de terre, maltodextrine, sucre, extrait de viande de baæuf, tomate, extrait de gibier, épices, oignon, plantes aromatiques, épaississant: gomme xanthane), beurre (lait), amidon de mais, 0,6% ail, sirop de caramel (sucre, sirop de glucose, eau), gélatine (boeuf), arôme naturel, 0,1% poivre, sauge, 0,02% thym, 0,02% laurier, 0,01% clou de girofle, acidifiant: lactate de sodium; protéines de lait), 35% civet de marcassin (92% viande de marcassin, euf*, amidon de pomme de terre, sirop de glucose, sel, huile de colza, sirop de caramel (sucre, sirop de glucose, eau), amidon de riz, sel, 0,01% poivre). *issu de poules élevées au sol. Peut contenir des traces d\'autres céréales contenant du gluten, de crustacés, de poisson, d\'arachides, de soja, de fruits à coque, de céleri, de moutarde, de graines de sésame et de moilusques. Conseil de préparation: au four à micro-ondes: perforer le film et réchauffer pendant 4 minutes à 750 watts.', 'https://static.openfoodfacts.org/images/products/20612290/front_fr.13.400.jpg', '5.8', '1.5', '7.1', '4.2', '1.7', '8.7', '1', '0.393700787401575', '', '1');

