VALUES ('20638634', 'Salade Poulet Rôti sauce Tandoori', 'Pain spécial 44% (farine de _blé_, eau, farine de _seigle_, sucre, huile de colza, sirop de sucre, _gluten de blé_, sel, levure, levain de _seigle_ déshydraté, poudre à lever : E503, fructose, farine de malt d\'_orge_, agent de traitement de la farine : E300), dés de poulet rôti traité en salaison 24.5% (filet de poulet 23.5%, amidon de tapioca, dextrose, sel), sauce tandoori 15% (yaourt 9% (_lait_) (_lait_ pasteurisé, ferments lactiques), huile de colza, sucre, eau, sel, _moutarde_ (eau, graines de _moutarde_, vinaigre d\'alcool, sel, conservateur : sulfite acide de sodium), jaune d\'_oeuf_, épices tandoori 0.3%, vinaigre d\'alcool, épaississants : E412, E415, conservateur : E202, acidifiant : E334, colorant : E120), salade 14.5%, dextrose 0.6%, épices tandoori, légumes en poudre (tomate, oignon), sel, colorants : carmins, E160c, arômes naturels, arôme de fumée, acidifiant : E330.', 'https://static.openfoodfacts.org/images/products/20638634/front_fr.7.400.jpg', '6', '1.8', '25.5', '5.9', '', '10.6', '1.26', '0.496062992125984', '', '0');

